import React, { Component } from "react";

class RightPanel extends Component {
  state = {};
  render() {
    return (
      <div id="rightpanel">
        <div className="right_panel_content">
          <div id="group_balances">
            <h6>GROUP BALANCES</h6>
          </div>
        </div>
      </div>
    );
  }
}

export default RightPanel;
